<h2>Arabis alpina floral scent molecular network</h2>

<h3>Description</h3>

<p>A molecular network. Generated by the <code>molNet</code> function
used on the <code>alpinaCompDis</code> dataset, with
<code>cutOff = 0.75</code>.
</p>


<h3>Usage</h3>

<pre><code class="language-R">alpinaMolNet
</code></pre>


<h3>Format</h3>

<p>A <code>tbl_graph</code> object with 15 nodes and 56 edges.
</p>
